import React from 'react';
import { BrowserRouter, Route,Routes } from 'react-router-dom';
import PocetnaStranica from './components/PocetnaStranica';
import Registracija from './components/Registracija';
import Logovanje from './components/Logovanje';
import UlogovanKorisnik from './components/UlogovanKorisnik';
import Profil from './components/Profil';
import PregledArtikala from './components/PregledArtikala';
import PrethodnePorudzbine from './components/PrethodnePorudzbine';
import DodavanjeArtikla from './components/DodavanjeArtikla';
import StarePorudzbine from './components/StarePorudzbine';
import NovePorudzbine from './components/NovePorudzbine';
import Verifikacija from './components/Verifikacija';
import PrikazVerifikacija from './components/PrikazVerifikacija';
import ProtectedRoute from './services/KorisnikService';


const App=()=>{
  return (
    <div>
    <BrowserRouter>
      <Routes>
          <Route path="/" element={<PocetnaStranica />} />
          <Route exact path='/pocetna-stranica'  element={<PocetnaStranica/>}/>
          <Route path='/registracija' element={<Registracija/>}/>
          <Route path='/logovanje' element={<Logovanje/>}/>
          <Route path='/ulogovan-korisnik/profil' element={<Profil/>}/>
          <Route path='ulogovan-korisnik' element={<UlogovanKorisnik/>}/>
          {/*Kupac moze da vidi */}
          <ProtectedRoute path='/ulogovan-korisnik/pregled-artikala' element ={<PregledArtikala/>} allowedRoles={['Kupac']}/>
          <ProtectedRoute path='/ulogovan-korisnik/prethodne-porudzbine' element={<PrethodnePorudzbine/>} allowedRoles={['Kupac']}/>
          {/*Prodavac moze da vidi */}
          <ProtectedRoute path='/ulogovan-korisnik/dodaj-artikal' element={<DodavanjeArtikla/>} allowedRoles={['Prodavac']}/>
          <ProtectedRoute path='/ulogovan-korisnik/moje-porudzbine' element={<StarePorudzbine/>} allowedRoles={['Prodavac']}/>
          <ProtectedRoute path='/ulogovan-korisnik/nove-porudzbine' element={<NovePorudzbine/>} allowedRoles={['Prodavac']}/>
          {/*Admin moze da vidi */}
          <ProtectedRoute path='/ulogovan-korisnik/verifikacija' element={<Verifikacija/>} allowedRoles={['Admin']}/>
          <ProtectedRoute path='/ulogovan-korisnik/prikaz-verifikacija' element={<PrikazVerifikacija/>} allowedRoles={['Admin']}/>
      </Routes>
    </BrowserRouter>
    </div>
  );
};

export default App;
